import React from "react";
import Sec3 from "../assets/Sec3.jpg";

const Section3 = () => {
  return (
    <section className="Section3">
      <div className="Sec3_left">
        <p>Meet your host</p>
        <p>Jacob Paulaner</p>
        <p>
          Jacob has a background in audio engineering, and has been podcasting
          since the early days.
        </p>
        <p>
          He’s here to help you level up your game by sharing everything he’s
          learned along the way.
        </p>
      </div>
      <div className="Sec3_right">
        <img src={Sec3} />
      </div>
    </section>
  );
};

export default Section3;
